import React, { Component } from 'react';
import handleChange from "../utils";



export default class Flatbench extends Component {
    constructor(props) {
        super(props);
        this.state = {
            status: "not selected"
        };
      }
    render() {
        return (        
            <>
                <li><span onClick={handleChange} className="plus"><i class="fa fa-plus"></i></span>Flat Bench</li>     
            </>
        )
    }       
    
};
